import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

export default class Header extends React.Component{

  render(){
    return(
      <h1 className="text-center my-4 mx-1 mx-md-0 headerStyle fontStyling"> {this.props.title} </h1>
    );
  }
}

export class PicTextLayout extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <Grid container spacing={3}>
          <Grid className="whiteBack" item xs={3}>
            <p> hello</p>
          </Grid>
          <Grid className="whiteBack" item xs={9}>
            <p> hello</p>
          </Grid>
        </Grid>
      </div>
    );
  }
}
